import React from 'react'
import PayWithPayPal from './Payment/PayWithPayPal'
import styled from 'styled-components';

const StyledDonations = styled.div`
    margin-top: 30px;

    @media (min-width: 769px) {
      display: flex;
      columns: 50% 2;
      flex-wrap: wrap;
    }

    div {
        width: 330px;
        margin:5px auto;
    }
    
`

function Donations() {
    return (
        <StyledDonations>
            <div>
                <PayWithPayPal item={{name:'test', value:100.10}} />
            </div>
            <div>
                <PayWithPayPal item={{name:'test2', value:99.10}} />
            </div>
            <div>
                <PayWithPayPal item={{name:'test2', value:99.10}} />
            </div>
        </StyledDonations>
    )
}

export default Donations
